(109, 0, 'pnt', 96, 1, '2013-11-12 20:52:44', -1, 'Историки утверждают, что основателем МакДональдс был Вельзевул. Именно ему приписывают фразу «Сколько ни съешь, все равно в WC бежать придется» и «Грустно и невкусно». Вельзевул заложил основы фекальной промышленности, первую фекальную фабрику Калгейт, а также сеть общественных туалетов, ныне называемую Макфаком. Как гласит закон сохранения энергии, придуманный знаменитым ученым Эйнштейном, «ничто не исчезает без следа, также как и не появляется из ничего». Поэтому для производства фекальных масс было решено использовать процесс переработки еды, приготовленной в точках общепита, сопряженных с туалетами. Или наоборот.\n\nТакже, считается что Мак создали америкосы чтобы люди с расстройством желудка бегали в платные больницы.\n\nЕсть и другая версия, согласно которой основателем МакДональдса является Икслер. Есть также еще одна версия что оснавателем Макдональдса был Сатана, придумавший Макдональдс, посланный от нечего делать в адской яме, куда его послал его же одтеЦ.\n\nНазвание также происходит от имени нечистого (яп. 魔食堂— ма-ку-до— место, где ест дьявол). ', 'Историки утверждают, что основателем МакДональдс был Вельзевул. Именно ему приписывают фразу «Сколько ни съешь,...', 0, 0),
